import React from "react";

function ProfileCard({ currentUser }) {
  const { id, username, admin } = currentUser;

  return (
    <div>
      <br></br>
      <br></br>
      <h4>{currentUser.id}</h4>
      <h5>{currentUser.username}</h5>
      <p>{currentUser.admin}</p>
      <br></br>
      <br></br>
    </div>
  );
}

export default ProfileCard;
